import React, { Component } from 'react';

export default class Summary extends Component{
    render(){
        return(
            <div>
                <h2>Summary Page</h2>
                    <p>First name: {this.props.value.firstName}</p>
                    <p>Last name: {this.props.value.lastName}</p>
            </div>
        );
    }
}
